import React from 'react';
import { useSpring, animated } from 'react-spring';

const RegistrationForm = () => {
  // Define animated styles for the wave motion
  const waveProps = useSpring({
    from: { transform: 'translateX(0px)' },
    to: { transform: 'translateX(-50px)' },
    config: { duration: 2000, loop: true },
  });

  return (
    <div className="registration-form-container">
      {/* Animated wave motion background */}
      <animated.div className="wave-background" style={waveProps} />

      {/* Actual registration form */}
      <div className="registration-form">
        {/* Your registration form elements go here */}
      </div>
    </div>
  );
};

export default RegistrationForm;
